func TestTrieSearch(t *testing.T) {
	trie := Constructor()
	trie.Insert("apple")
	if !trie.Search("apple") {
		t.Errorf("[apple].Search(%v) = false; want true\n", "apple")
		return
	}
	if trie.Search("app") {
		t.Errorf("[apple].Search(%v) = true; want false\n", "app")
		return
	}

	trie.Insert("app")
	if !trie.Search("app") {
		t.Errorf("[apple, app].Search(%v) = false; want true\n", "app")
	}
}

func TestTrieStartsWith(t *testing.T) {
	trie := Constructor()
	trie.StartsWith("app")
	if trie.StartsWith("app") {
		t.Errorf("[].StartsWith(%v) = true; want false\n", "app")
		return
	}
	trie.Insert("apple")
	if !trie.StartsWith("app") {
		t.Errorf("[apple].StartsWith(%v) = false; want true\n", "app")
	}
}
